import React from 'react';
import "bootstrap/dist/css/bootstrap.css";

export default function UserPost({post}){
    return (
       <div>
        <img src={`${require(`../../rest/uploads/${post.image.slice(8)}`)}`}/>
        <h2>{post.title}</h2>
        <div>
            <span>{post.author.username}</span>
            <span>{post.date}</span>
        </div>
        <p>{post.summary}</p>
       </div>
    );
}
